import React from "react";
import Button from "@material-ui/core/Button";
import { Paper } from '@material-ui/core';
import './App.css'

function App() {
  return (
    <>
    <Paper>

    <Button variant="contained" color="primary">
      Hello World
    </Button>
    </Paper>
    </>
  );
}

export default App;
